// Importing React and useState for managing selected lab
import React, { useState } from 'react';

// ✅ Import Lab Components
import GroceryList from './GroceryList';          // Lab 1
import Car from './Car';                         // Lab 2
import Phone from './Phone';                     // Lab 3
import SweetsList from './SweetsList';           // Lab 4
import Electronics from './Electronics';         // Lab 5
import CanteenMenu from './CanteenMenu';         // Lab 6
import JuiceList from './JuiceList';             // Lab 7
import Restaurant from './Restaurant';           // Lab 8
import TempleList from './TempleList';           // Lab 9
import TailorShop from './TailorShop';           // Lab 10
import FruitsLab11 from './FruitsLab11';         // Lab 11
import TelevisionLab12 from './TelevisionLab12'; // Lab 12

// ✅ Main App Component
function App() {
  // State to track which lab is active
  const [lab, setLab] = useState('');

  // Lab 1 sample grocery items
  const groceries = ['Rice', 'Wheat', 'Sugar', 'Milk', 'Oil'];

  return (
    <div className="App container mt-4">
      {/* Main Heading */}
      <h1 className="text-center mb-4">React Labs Project</h1>

      {/* ✅ Navigation Buttons */}
      <div className="d-flex flex-wrap gap-2 mb-4">
        <button className="btn btn-outline-primary" onClick={() => setLab('lab1')}>Lab 1 - GroceryList</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab2')}>Lab 2 - Car Component</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab3')}>Lab 3 - Phone</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab4')}>Lab 4 - Sweets List</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab5')}>Lab 5 - Electronics</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab6')}>Lab 6 - Canteen Menu</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab7')}>Lab 7 - Juice List</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab8')}>Lab 8 - Restaurant Menu</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab9')}>Lab 9 - Temple List</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab10')}>Lab 10 - Tailor Shop</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab11')}>Lab 11 - Fruits List</button>
        <button className="btn btn-outline-primary" onClick={() => setLab('lab12')}>Lab 12 - Television Manager</button>
      </div>

      {/* ✅ Conditional Rendering of Labs */}
      {lab === 'lab1' && <GroceryList items={groceries} />}
      {lab === 'lab2' && <Car brand="Toyota" model="Fortuner" color="Black" year="2022" />}
      {lab === 'lab3' && <Phone />}
      {lab === 'lab4' && <SweetsList />}
      {lab === 'lab5' && <Electronics />}
      {lab === 'lab6' && <CanteenMenu />}
      {lab === 'lab7' && <JuiceList />}
      {lab === 'lab8' && <Restaurant />}
      {lab === 'lab9' && <TempleList />}
      {lab === 'lab10' && <TailorShop />}
      {lab === 'lab11' && <FruitsLab11 />}
      {lab === 'lab12' && <TelevisionLab12 />}
    </div>
  );
}

// Export main App component
export default App;
